import React, { useState } from 'react';
function App() {
  const [formData, setFormData] = useState({
    currentMarketValue: 0,
    carpetArea: 0,
    pincode: '',
    ageOfBuilding: '',
    affectedByDisaster: 'No',
    security24x7: 'No',
    isSalaried: 'No',
  });

  const [totalSum, setTotalSum] = useState(0);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const calculateSum = () => {
    let sum = 0;

    sum += 0.01 * formData.currentMarketValue;
    sum += formData.currentMarketValue;
    sum += formData.carpetArea;

    switch (formData.ageOfBuilding) {
      case '0-5years':
        sum += 100;
        break;
      case '5-10years':
        sum += 200;
        break;
      case '10-15years':
        sum += 300;
        break;
      case '15-20years':
        sum += 400;
        break;
      case '20-25years':
        sum += 500;
        break;
      default:
        break;
    }

    if (formData.affectedByDisaster === 'Yes') {
      sum += 100;
    }

    if (formData.security24x7 === 'Yes') {
      sum += 100;
    } else {
      sum -= 200;
    }

    if (formData.isSalaried === 'Yes') {
      sum += 150;
    } else {
      sum += 50;
    }

    setTotalSum(sum);
  };

  const handleProceed = () => {
    calculateSum();
    alert(`Estimated Sum of details: ${totalSum}`);
  };

  return (
    <div>
      <div>
        <h2>Structure Details</h2>
        <label>
          Current Market Value of Property:
          <input
            type="number"
            name="currentMarketValue"
            value={formData.currentMarketValue}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Carpet Area/sq.ft:
          <input
            type="number"
            name="carpetArea"
            value={formData.carpetArea}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Enter Pincode:
          <input
            type="text"
            name="pincode"
            value={formData.pincode}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Age of Building:
          <div>
            <input
              type="radio"
              name="ageOfBuilding"
              value="0-5years"
              checked={formData.ageOfBuilding === '0-5years'}
              onChange={handleInputChange}
            />
            0-5 years
          </div>
          <div>
            <input
              type="radio"
              name="ageOfBuilding"
              value="5-10years"
              checked={formData.ageOfBuilding === '5-10years'}
              onChange={handleInputChange}
            />
            5-10 years
          </div>
          <div>
            <input
              type="radio"
              name="ageOfBuilding"
              value="10-15years"
              checked={formData.ageOfBuilding === '10-15years'}
              onChange={handleInputChange}
            />
            10-15 years
          </div>
          <div>
            <input
              type="radio"
              name="ageOfBuilding"
              value="15-20years"
              checked={formData.ageOfBuilding === '15-20years'}
              onChange={handleInputChange}
            />
            15-20 years
          </div>
          <div>
            <input
              type="radio"
              name="ageOfBuilding"
              value="20-25years"
              checked={formData.ageOfBuilding === '20-25years'}
              onChange={handleInputChange}
            />
            20-25 years
          </div>
        </label>
        <br />
        <label>
          Has your property been affected by floods/earthquake in the past 5 years:
          <select
            name="affectedByDisaster"
            value={formData.affectedByDisaster}
            onChange={handleInputChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
      </div>

      <div>
        <h2>Security Measures</h2>
        <label>
          24*7 Security:
          <select
            name="security24x7"
            value={formData.security24x7}
            onChange={handleInputChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
        <br />
        <label>
          Are you a salaried individual?:
          <select
            name="isSalaried"
            value={formData.isSalaried}
            onChange={handleInputChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
      </div>

      <button onClick={handleProceed}>Proceed</button>

      <div>
        <h2>Estimated Total Sum of Details</h2>
        <p>{totalSum}</p>
      </div>
    </div>
  );
}

export default App;
